import React from "react";
import UploadButtonStyled from "../styled/commonStyled/UploadButtonStyled";
import { FaPlus } from "react-icons/fa";

const Upload = () => {
  return (
    <div>
      <UploadButtonStyled>
        <FaPlus size="30px" />
      </UploadButtonStyled>
    </div>
  );
};

export default Upload;
